import React from "react";

type Skills = {
    name:string,
    group: string,
    icon: string,
    inprogress:boolean
}

const SkillsData: Skills[] = [
  {
    name: "JavaScript",
    group: 'language',
    icon: '<i class="devicon-javascript-plain"></i>',
    inprogress: false
  },
  {
    name: "TypeScript",
    group: 'language',
    icon: '<i className="devicon-typescript-plain colored"></i>',
    inprogress: false
  },
];

export default SkillsData;
